import Header from './components/Header'
import MainSection from './components/MainSection';
import VideoSection from './components/VideoSection';

function App() {
  return (
    <div>
    	<Header/>
      	<div className='fullWrapper'>
			<VideoSection />
        	<MainSection />
      	</div>
    </div>
  );
}

export default App;
